        /// <summary>
        /// 暴力穷举
        /// </summary>
        /// <param name="words"></param>
        /// <returns></returns>
        public static int MaxProduct(string[] words)
        {
            int sum = 0;

            List<List<char>> list = new List<List<char>>();

            int[] numbers = new int[words.Length];

            ///int是32位可以替代flg数组，用 与（&），或（1），以及向左移位（<<）就能完成。如“abcd” 的int值为 0000 0000 0000 0000 0000 0000 0000 1111，
            ///“wxyz” 的int值为 1111 0000 0000 0000 0000 0000 0000 0000，这样两个进行与（&）得到0， 如果有相同的字母则不是0。
            for (int i = 0; i < words.Length; i++)
            {
                int number=0;
                for (int j = 0; j < words[i].Length; j++)
                {
                    number += (1 << words[i][j] - 'a');
                }
                numbers[i] = number;
            }

            for (int i = 0; i < words.Length; i++)
            {
                list.Add(words[i].ToArray().Distinct().ToList());
            }

            for (int i = 0; i < words.Length; i++)
            {
                for (int j = i + 1; j < words.Length; j++)
                {
                    if (!HaveSameLetters(list[i], list[j]))
                    {
                        sum = Math.Max(sum, words[i].Length * words[j].Length);
                    }
                }
            }

            return sum;

        }

        public static bool HaveSameLetters(List<char> a, List<char> b)
        {
            for (int i = 0; i < a.Count; i++)
            {
                for (int j = 0; j < b.Count; j++)
                {
                    if(a[i]==b[j])
                    {
                        return true;
                    }

                }
            }
            return false;
        }
